import React from "react";
import VideoPlayer from "./components/VideoPlayer";
import OverlayEditor from "./components/OverlayEditor";

function App() {
  const rtspUrl = "http://localhost:8554/live/stream.m3u8"; // example via ffmpeg relay
  return (
    <div className="container mx-auto p-4">
      <h2 className="text-xl font-bold mb-4">RTSP Livestream with Overlays</h2>
      <VideoPlayer rtspUrl={rtspUrl} />
      <OverlayEditor />
    </div>
  );
}

export default App;
